import React from 'react';

class Signin extends React.Component {
    constructor() {
        this.state = {
            signInEmail: '',
            signInPasword: ''
        }
    }

    onEmailChange = (event) => {
        this.setState({signInEmail: event.target.value})
    }
    onPasswordChange = (event) => {
        this.setState({signInPasword: event.target.value})
    }
    render() {
        return (
            <article className="br3 ba dark-gray b--black-10 mv4 w-100 w-50-m w-25-1 mw6 shadow-5 center">
                <main className="pa4 black-80">
                <form className="measure">
                    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                    <legend className="f1 fw6 ph0 mh0">Sign In</legend>
                    <div className="mt3">
                        <label className="db fw6 lh-copy f6" htmlfor="email-address">Email</label>
                        <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address"  id="email-address" />
                    </div>
                    <div className="mv3">
                        <label className="db fw6 lh-copy f6" htmlfor="password">Password</label>
                        <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password"  id="password" />
                    </div>
                    </fieldset>
                    <div className="">
                        <input 
                        onClick={() => this.props.onRouteChange('home')}
                        className="b f6 link dim br3 ba b--black bw1 bg-transparent ph3 pv2 mb2 dib pointer black" 
                        type="submit" 
                        value="Sign in" />
                     </div>
                    <div className="lh-copy mt3 pointer">
                        <p onClick={() => this.props.onRouteChange('register')} className="f6 link dim black db">Register</p>
                    </div>
                </form>
                </main>
            </article>
        );
    }

}

export default Signin;
